<?php 

    /**
     * @param String $s
     * @return Integer
     */
    function lengthOfLongestSubstring($s) {
		//if( !isset($s) || $s == '') return 0;
		$n = strlen($s);
		$max = 0;
		$chars=[];
		for($i = 0,$j = 0;$j<$n;$j++){
			$char = substr($s,$j,1);
			if(array_key_exists($char,$chars)){
				$i = max($chars[$char],$i);
			}
			$chars[$char] = $j+1;
			$max = max($max,$j-$i+1);
		}
		
		return $max;
	}
	

	
